import React, {Component} from "react";
import './Register.scss';
import {Container, createStyles, FormControl, FormHelperText, Grid, InputLabel, Paper, Theme} from "@material-ui/core";
import {makeStyles} from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";

const useStyles = makeStyles(theme => ({
    paper: {
        marginTop: theme.spacing(8),
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
    },
    avatar: {
        margin: theme.spacing(1),
        backgroundColor: theme.palette.secondary.main,
    },
    form: {
        width: '100%', // Fix IE 11 issue.
        marginTop: theme.spacing(3),
    },
    submit: {
        margin: theme.spacing(3, 0, 2),
    },
}));

export default function CenteredGrid() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Container>
                <Grid container spacing={0}>
                    <Grid item xs={6}>
                        <Paper className={classes.paper}>
                            <form className={classes.form} noValidate autoComplete="off">
                                <div className="form-group">
                                    <TextField required id="standard-required" label="Email" defaultValue=""  aria-describedby="my-helper-text"/>
                                    <FormHelperText id="my-helper-text">We'll never share your email.</FormHelperText>
                                </div>
                            </form>
                        </Paper>
                    </Grid>
                    <Grid item xs={6}>
                        <Paper className={classes.paper}>


                        </Paper>
                    </Grid>
                </Grid>
            </Container>
        </div>
    );
}
